import React from 'react';
import styled from 'styled-components';

const HomeContainer = styled.div`
  padding: 20px;
  text-align: center;
`;

const Home = () => {
  return (
    <HomeContainer>
      <h1>Welcome to Spotify 2.0</h1>
    </HomeContainer>
  );
};

export default Home;
